export interface ISubItemElement extends IElementBase{
 	/**ID*/
	id:number
	/**注释*/
	mark:string
	/**道具名字*/
	name:string
	/**道具名称注释*/
	name_desc:string
	/**道具图标*/
	icon:string
	/**道具提示*/
	tip:string
	/**道具提示的注释*/
	tip_desc:string
	/**描述*/
	description:string
	/**道具描述的注释*/
	description_desc:string
	/**是否是可消耗品（0:false*/
	isConsumable:boolean
	/**1true）*/
	isCanActiveUse:boolean
	/**是否可以主动使用*/
	useGamesDistriction:Array<string>
	/**使用游戏限制填入的游戏才能使用不填默认所有游戏都可用*/
	isHideInBag:boolean
	/**是否在背包隐藏*/
	useEffect:Array<Array<string>>
	/**主动使用的效果*/
	useSound:Array<string>
	/**主动使用音效*/
	sound:number
	/**音效*/
	isCanDiscard:boolean
	/**是否可以丢弃*/
	isCanPick:boolean
	/**是否可以拾起*/
	quality:number
	/**道具品质*/
	type:number
	/**道具类型*/
	maxCount:number
	/**最大叠加数目*/
	maxGrid:number
	/**最多可以存多少格子*/
	prefab:string
	/**预制体(场景中的拾取道具客户端工程ID)*/
	res:string
	/**手持资源*/
	offsetLoc:mw.Vector
	/**道具偏移*/
	offsetRot:mw.Vector
	/**道具旋转*/
	scale:mw.Vector
	/**道具缩放*/
	otherLoc:mw.Vector
	/**别人看到的位移旋转和缩放*/
	otherRot:mw.Vector
	/**undefined*/
	otherScale:mw.Vector
	/**undefined*/
	clazz:string
	/**对应实现类（程序填写）*/
	clazzParam:Array<string>
	/**效果参数（对应建筑ID）充值：数量|充值金额|首充赠送|日常赠送*/
	surelyGift:Array<Array<number>>
	/**必定道具*/
	giftList:Array<Array<number>>
	/**礼包道具*/
	giftNum:Array<Array<number>>
	/**礼包内道具数量*/
	giftWeights:Array<number>
	/**礼包权重*/
	roomType:Array<number>
	/**房间类型*/
	refreshType:number
	/**刷新类型(脚本里是0的话都可以在那个位置刷新)*/
	difficuty:number
	/**难度刷新*/
	value:number
 } 
